import logo from "./logo.svg";
import data1 from "../src/Data/1.txt";
import "./App.css";

function App() {
  const convertToJSON = (data) => {
    return data.split("\n").map((entry) => {
      return JSON.parse(entry);
    });
  };
  convertToJSON(data1);
  console.log(data1);
  return <div className="App"></div>;
}

export default App;
